import React from "react";
import { List } from "react-router-dom";

const DateListing = (props) => {
  const renderlist = ({ datalist }) => {
    if (datalist) {
      console.log(datalist)
    //  console.log(datalist.near_earth_objects["2020-09-10"].length)
    //  console.log(Object.keys(datalist.near_earth_objects))
     var objLength=Object.keys(datalist.near_earth_objects)
    //  console.log(objLength.length)
     
    
     for(let j=0;j<objLength.length;j++){
      var len=objLength[j];
      // console.log(len)
      for(let i=0;i<len.length;i++){
        console.log(datalist.near_earth_objects[len][i].name)
        for(let k=0;k<datalist.near_earth_objects[len].length;k++){
          console.log(datalist.near_earth_objects[len][k].name)
        }
      }
     }
     
      // return datalist.near_earth_objects
      //   .filter((item, idx) => idx < 10)
      //   .map((item) => {
          // return (
          //   <div className="">
          //     <p key="{datalist.element_count}">Total number of Asteroids close to Earth between above dates is: {datalist.element_count}</p>
          //   </div>
          // );
        // });
       
      
    }
  };
  return <div>{renderlist(props)}</div>;
};

export default DateListing;
